import React from 'react'
import CartStyles from './styles/CartStyles'
import useUser from './User'

const Cart = () => {
    const me = useUser()
    if(!me) return null;
    return (
        <CartStyles open={true}>
            {me.email}
        </CartStyles>
    )
}

export default Cart
